<html>
  <head>
    <title>Make Your Own Blotch Logo</title>
  </head>
  <body>
    <div id="mainContainer">
      <a href="/"><strong>Stroke Version</strong></a>
      <form>
        <p>
          Scatter
          <input type="range" name="scatter" id="scatter" min="0.0" max="30.0" value="8.0" step="0.5">
        </p>
        <p>
          Radius Minimum
          <input type="range" name="radminimum" id="radminimum" min="0.0" max="10.0" value="0.25" step="0.05">
        </p>
        <p>
          Radius Maximum
          <input type="range" name="radmaximum" id="radmaximum" min="0.0" max="18.0" value="2.0" step="0.05">
        </p>
        <p>
          Speed
          <input type="range" name="speedvalue" id="speedvalue" min="100" max="5000" value="1500" step="50">
        </p>
      </form>
      <p>
        <a href="/2">Reset</a>
      </p>
    </div>
